import React, { useState } from "react";
import axios from "axios";

function App() {
  const [form, setForm] = useState({
    handle: "",
    title: "",
    body: "",
    type: "",
    category: "",
    brand_tone: ""
  });
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    setResult(null);
    const formData = new FormData();
    Object.entries(form).forEach(([k, v]) => formData.append(k, v));
    try {
      const res = await axios.post("http://localhost:8000/generate-seo", formData);
      setResult(res.data.result);
    } catch (err) {
      alert("Error generating SEO description.");
    }
    setLoading(false);
  };

  return (
    <div style={{ maxWidth: 600, margin: "40px auto", padding: 24, border: "1px solid #eee", borderRadius: 12 }}>
      <h2>SEO Product Description Generator</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Handle:<br />
          <input name="handle" value={form.handle} onChange={handleChange} required style={{ width: "100%" }} />
        </label>
        <br /><br />
        <label>
          Title:<br />
          <input name="title" value={form.title} onChange={handleChange} required style={{ width: "100%" }} />
        </label>
        <br /><br />
        <label>
          Body:<br />
          <textarea name="body" value={form.body} onChange={handleChange} required style={{ width: "100%" }} rows={3} />
        </label>
        <br /><br />
        <label>
          Type:<br />
          <input name="type" value={form.type} onChange={handleChange} required style={{ width: "100%" }} />
        </label>
        <br /><br />
        <label>
          Product Category:<br />
          <input name="category" value={form.category} onChange={handleChange} required style={{ width: "100%" }} />
        </label>
        <br /><br />
        <label>
          Brand Tone (optional):<br />
          <input name="brand_tone" value={form.brand_tone} onChange={handleChange} style={{ width: "100%" }} />
        </label>
        <br /><br />
        <button type="submit" disabled={loading} style={{ padding: "8px 24px" }}>
          {loading ? "Generating..." : "Generate SEO Description"}
        </button>
      </form>

      {result && (
        <div style={{ marginTop: 32 }}>
          <h3>Optimized Output</h3>
          <div><b>Optimized Title:</b> {result.optimized_title}</div>
          <div style={{ margin: "12px 0" }}><b>Optimized Body:</b> {result.optimized_body}</div>
          <div><b>Keywords Used:</b> {result.keywords_used}</div>
        </div>
      )}
    </div>
  );
}

export default App;
